DROP TABLE IF EXISTS `EC2-releases`;

CREATE TABLE `EC2-releases` (
  `_index` int(11) NOT NULL,
  `uid` varchar(255) NOT NULL DEFAULT '',
  `instance_type` varchar(255) DEFAULT NULL,
  `instance_category` varchar(255) DEFAULT NULL,
  `instance_generation` varchar(255) DEFAULT NULL,
  `release_month` varchar(255) DEFAULT NULL,
  `release_year` varchar(255) DEFAULT NULL,
  `product_page` varchar(255) DEFAULT NULL,
  `announcement_url` varchar(255) DEFAULT NULL,
  `announcement_published` varchar(255) DEFAULT NULL,
  `blog_post_url` varchar(255) DEFAULT NULL,
  `blog_post_published` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`_index`),
  UNIQUE KEY `uid` (`uid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

LOCK TABLES `EC2-releases` WRITE;


UNLOCK TABLES;